import React, { Component } from "react";
import { Link } from "react-router-dom";
import {
  Badge,
  BreadcrumbItem,
  Breadcrumb,
  Container,
  Sidebar
} from "reactstrap";
class Header extends Component {
  render() {
    return (
      <div class="ui inverted segment">
        <div class="ui inverted secondary pointing menu">
          <Link class="active item">Home</Link>
          <Link class="item">Items</Link>
          <Link class="item">Units</Link>
          <Link class="item">Transactions</Link>
          <Link class="item">Stocks</Link>
        </div>
      </div>
    );
  }
}

export default Header;
